selector_to_html = {"a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminateur<a class=\"headerlink\" href=\"#terminator\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Param\u00e8tres de caract\u00e8re de fin<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le caract\u00e8re de fin est ajout\u00e9 apr\u00e8s le d\u00e9codage des donn\u00e9es au format des donn\u00e9es d\u00e9cod\u00e9es + caract\u00e8re de fin.</p>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id9\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de scan<a class=\"headerlink\" href=\"#scan-mode\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Mode de d\u00e9clenchement des touches<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Appuyez sur le bouton pour d\u00e9clencher la num\u00e9risation, et rel\u00e2chez le bouton pour terminer la num\u00e9risation. La num\u00e9risation se termine lorsque le scan r\u00e9ussit ou que le temps de lecture d\u00e9passe le temps de lecture unique.</p>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 128<a class=\"headerlink\" href=\"#code-128\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id19\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Transmettre le code ID du personnage<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Lien vers cette rubrique\">#</a></h2><p>Un caract\u00e8re ID de code identifie le type de code d\u2019un code \u00e0 barres scann\u00e9. Cela peut \u00eatre utile lors du d\u00e9codage de plusieurs types de code. Le caract\u00e8re ID du code est ins\u00e9r\u00e9 entre le caract\u00e8re pr\u00e9fixe (si s\u00e9lectionn\u00e9) et le symbole d\u00e9cod\u00e9.</p>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 93<a class=\"headerlink\" href=\"#code-93\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id17\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id12\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#enable-disable\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9tection automatique<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Dans le mode de d\u00e9tection automatique, le scanner d\u00e9tecte la luminosit\u00e9 de l\u2019environnement environnant. Lorsque la luminosit\u00e9 change, le scan est d\u00e9clench\u00e9. Le scan se termine lorsque le scan est r\u00e9ussi ou que le temps de scan d\u00e9passe le temps de travail unique. Peu importe si le dernier scan a \u00e9t\u00e9 r\u00e9ussi ou a \u00e9chou\u00e9, la luminosit\u00e9 de l\u2019environnement environnant sera \u00e0 nouveau d\u00e9tect\u00e9e.</p>", "a[href=\"barcode.html#industrial-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Industrie 2 sur 5<a class=\"headerlink\" href=\"#industrial-2-of-5\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id27\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-limited-rss-limited\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barre de donn\u00e9es GS1 Limit\u00e9e(RSS Limit\u00e9)<a class=\"headerlink\" href=\"#gs1-databar-limited-rss-limited\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id21\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#m1-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guide d\u2019installation rapide du scanner filaire <strong>M1</strong><a class=\"headerlink\" href=\"#m1-wired-scanner-quick-setup-guide\" title=\"Lien vers cette rubrique\">#</a></h1>", "a[href=\"barcode.html#china-post\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Poste de Chine<a class=\"headerlink\" href=\"#china-post\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id29\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode continu<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le scanner fonctionne en continu. Si le scan est r\u00e9ussi ou si le temps de scan d\u00e9passe le temps de travail unique, le scan actuel se termine. Si le temps d\u00e9passe le temps sp\u00e9cifi\u00e9, la prochaine analyse est automatiquement d\u00e9clench\u00e9e.</p>", "a[href=\"barcode.html#interleaved-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Intercal\u00e9 2 sur 5<a class=\"headerlink\" href=\"#interleaved-2-of-5\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id24\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurer les param\u00e8tres par d\u00e9faut<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Lorsqu\u2019une erreur inconnue se produit sur le scanner, vous pouvez r\u00e9initialiser le scanner en restaurant les param\u00e8tres par d\u00e9faut.</p>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">R\u00e9glages du volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Scannez le code de r\u00e9glage correspondant pour activer/d\u00e9sactiver l\u2019invite sonore du scanner</p>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id5\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Dupliquer les param\u00e8tres de d\u00e9tection de codes \u00e0 barres<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Lien vers cette rubrique\">#</a></h2><h3>D\u00e9sactiver<a class=\"headerlink\" href=\"#id1\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#matrix-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrice 2 sur 5<a class=\"headerlink\" href=\"#matrix-2-of-5\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id28\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtenir la version du Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 39<a class=\"headerlink\" href=\"#code-39\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id14\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#msi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI<a class=\"headerlink\" href=\"#msi\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id30\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#plessey-telepen\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Plessey/Telepen<a class=\"headerlink\" href=\"#plessey-telepen\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id34\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies<a class=\"headerlink\" href=\"#symbologies\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Symbologies inverses<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Langue du clavier<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Am\u00e9ricain<a class=\"headerlink\" href=\"#american\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id1\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9clenchement des touches<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Appuyez sur le bouton pour d\u00e9clencher la num\u00e9risation, et rel\u00e2chez le bouton pour terminer la num\u00e9risation. La num\u00e9risation se termine lorsque le scan r\u00e9ussit ou que le temps de lecture d\u00e9passe le temps de lecture unique.</p>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres du syst\u00e8me<a class=\"headerlink\" href=\"#system-settings\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Restaurer les param\u00e8tres par d\u00e9faut<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Lorsqu\u2019une erreur inconnue se produit sur le scanner, vous pouvez r\u00e9initialiser le scanner en restaurant les param\u00e8tres par d\u00e9faut.</p>", "a[href=\"barcode.html#reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies inverses<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 11<a class=\"headerlink\" href=\"#code-11\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id13\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-omnidirectional-rss-omnidirectional\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barre de donn\u00e9es GS1 Omnidirectionnelle(RSS Omnidirectionnel)<a class=\"headerlink\" href=\"#gs1-databar-omnidirectional-rss-omnidirectional\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id22\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-expanded-rss-expanded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barre de donn\u00e9es GS1 \u00e9tendue (RSS \u00e9tendu)<a class=\"headerlink\" href=\"#gs1-databar-expanded-rss-expanded\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Activer/D\u00e9sactiver<a class=\"headerlink\" href=\"#id23\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres du clavier<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Langue du clavier<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Lien vers cette rubrique\">#</a></h2><h3>Am\u00e9ricain<a class=\"headerlink\" href=\"#american\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Param\u00e8tres de caract\u00e8re de fin<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le caract\u00e8re de fin est ajout\u00e9 apr\u00e8s le d\u00e9codage des donn\u00e9es au format des donn\u00e9es d\u00e9cod\u00e9es + caract\u00e8re de fin.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
